import React, {useEffect, useState} from "react";
import Login from "./Login";
import {getRedirectStatus, getRank} from "../helpers/redirection";
import EditionManager__chief from "./chief/EditionManager__chief";
import EditionManager__redactor from "./redactors/EditionManager__redactor";
import Editor__chief from "./chief/Editor__chief";
import Editor__redactor from "./redactors/Editor__redactor";

export function Editor() {

    const [rank, setRank] = useState("");
    const [isRedactor, setState] = useState("");
    useEffect(() => {
        getRank()
            .then(resp => {
                setRank(resp)
            }, [])
    });

    return(
        <>
            {rank == "arriviste" && <Navigate to={"/"}/>}
            {rank == "admin" && <Editor__chief/>}
            {rank == "redactor" && <Editor__redactor/>}
        </>
    )

}
